gqx(){return"Datenschutzrichtlinie \u2013 ASConnect-App\n\n1) Verantwortlicher\nDie in der ASConnect-App erhobenen Daten werden von FAST France als Verantwortlichem verarbeitet.\nWenn du Fragen zu deinen Daten oder zur Aus\xfcbung deiner Rechte hast, kontaktiere uns unter: contact@fastfrance.org.\n\n2) Zwecke der Verarbeitung\nDie \xfcber die App durchgef\xfchrten Verarbeitungen dienen folgenden Zwecken:\n\u2022 Erstellen und Verwalten deines Benutzerkontos f\xfcr den Zugriff auf die ASConnect-App;\n\u2022 Nutzung von Geolokalisierungsfunktionen zur Anzeige:\n  o von relevanten Points of Interest zum Angelman-Syndrom,\n  o und/oder Profilen betroffener Personen nach verschiedenen Kriterien (geografische Entfernung, Genotyp, Altersbereich);\n\u2022 Verbesserung des Dienstes und Personalisierung der Nutzererfahrung, einschlie\xdflich der M\xf6glichkeit, ein Foto, den Vornamen oder den Nachnamen anzuzeigen.\n\n3) Kategorien der erhobenen Daten\nEs k\xf6nnen folgende Daten erhoben werden:\n\u2022 Identifikationsdaten:\n  o Nachname, Vorname, E-Mail-Adresse, Passwort, Foto,\n  o Sicherheitsfrage und Antwort (bei vergessenem Passwort);\n\u2022 Sensible Daten:\n  o Genotyp, Standort des Telefons (Geolokalisierung).\nRechtsgrundlage ist die ausdr\xfcckliche und informierte Einwilligung der Nutzerin/des Nutzers.\n\n4) Speicherdauer\nDie Daten werden f\xfcr die Dauer der Kontonutzung gespeichert und anschlie\xdfend sp\xe4testens innerhalb von 12 Monaten nach der letzten Aktivit\xe4t gel\xf6scht.\nDas Recht auf Vergessenwerden kann jederzeit direkt in der App ausge\xfcbt werden:\nDatenschutzrichtlinie \u2192 Recht auf Vergessenwerden.\n\n5) Empf\xe4nger und Hosting\nDie Daten werden sicher auf PythonAnywhere-Servern gehostet.\nDie Daten werden in der Europ\xe4ischen Union gespeichert.\n(Weitere Informationen: https://www.pythonanywhere.com/privacy/.)\n\n6) Rechte der Nutzer\nGem\xe4\xdf Verordnung (EU) 2016/679 (DSGVO) haben Nutzer folgende Rechte:\n\u2022 Recht auf Auskunft, Berichtigung und L\xf6schung (\u201eRecht auf Vergessenwerden\u201c) \u2014 direkt \xfcber das Profil oder \xfcber Datenschutzrichtlinie \u2192 Recht auf Vergessenwerden;\n\u2022 Recht auf Widerspruch, Daten\xfcbertragbarkeit und Einschr\xe4nkung der Verarbeitung;\n\u2022 Recht, die Einwilligung jederzeit zu widerrufen.\nZur Aus\xfcbung dieser Rechte (au\xdfer dem in der App verf\xfcgbaren Recht) per E-Mail: contact@fastfrance.org.\n\n7) Sicherheit und Vertraulichkeit\nAlle Daten werden bei Speicherung und \xdcbertragung verschl\xfcsselt.\nPassw\xf6rter werden nach Best Practices gehasht, und die gesamte Kommunikation nutzt HTTPS.\n\n8) Ausdr\xfcckliche Einwilligung\nDie Registrierung in der ASConnect-App erfordert die ausdr\xfcckliche und informierte Einwilligung zur in Abschnitt 2 beschriebenen Verarbeitung.\nDie Einwilligung kann jederzeit \xfcber die Kontoeinstellungen oder per Kontakt an contact@fastfrance.org widerrufen werden."},
