gqx(){return"Informativa sulla privacy \u2013 app ASConnect\n\n1) Titolare del trattamento\nI dati raccolti nell'app ASConnect sono trattati da FAST France in qualit\xe0 di titolare del trattamento.\nPer qualsiasi domanda sui tuoi dati o su come esercitare i tuoi diritti, contattaci a: contact@fastfrance.org.\n\n2) Finalit\xe0 del trattamento\nIl trattamento dei dati effettuato tramite l'app serve alle seguenti finalit\xe0:\n\u2022 Creare e gestire il tuo account utente per accedere all'app ASConnect;\n\u2022 Utilizzare le funzioni di geolocalizzazione per mostrare:\n  o punti di interesse relativi alla sindrome di Angelman,\n  o e/o profili di persone interessate, secondo vari criteri (distanza geografica, genotipo, fascia d\u2019et\xe0);\n\u2022 Migliorare il servizio e personalizzare l\u2019esperienza utente, anche consentendo agli utenti di scegliere se mostrare una foto, il nome o il cognome.\n\n3) Categorie di dati raccolti\nPossono essere raccolti i seguenti dati:\n\u2022 Dati identificativi:\n  o cognome, nome, indirizzo email, password, foto,\n  o domanda e risposta segreta (in caso di password dimenticata);\n\u2022 Dati sensibili:\n  o genotipo, posizione del telefono (geolocalizzazione).\nLa base giuridica del trattamento \xe8 il consenso esplicito e informato dell\u2019utente.\n\n4) Periodo di conservazione dei dati\nI dati sono conservati per la durata dell\u2019utilizzo dell\u2019account, poi eliminati entro un massimo di 12 mesi dall\u2019ultima attivit\xe0.\nGli utenti possono esercitare il diritto all\u2019oblio in qualsiasi momento direttamente nell\u2019app tramite:\nInformativa sulla privacy \u2192 Diritto all'oblio.\n\n5) Destinatari e hosting dei dati\nI dati sono ospitati in modo sicuro sui server di PythonAnywhere.\nI dati sono archiviati nell\u2019Unione Europea.\n(Per maggiori informazioni sull\u2019informativa del provider, vedi https://www.pythonanywhere.com/privacy/.)\n\n6) Diritti degli utenti\nIn conformit\xe0 al Regolamento (UE) 2016/679 (GDPR), gli utenti hanno i seguenti diritti:\n\u2022 Diritto di accesso, rettifica e cancellazione (\u201cdiritto all\u2019oblio\u201d) \u2014 direttamente tramite il profilo o tramite Informativa sulla privacy \u2192 Diritto all'oblio;\n\u2022 Diritto di opposizione, portabilit\xe0 dei dati e limitazione del trattamento;\n\u2022 Diritto di revocare il consenso in qualsiasi momento.\nPer esercitare questi diritti (diversi dal diritto all\u2019oblio in-app), invia un\u2019email a: contact@fastfrance.org.\n\n7) Sicurezza e riservatezza\nTutti i dati sono criptati durante l\u2019archiviazione e la trasmissione.\nLe password sono hashate secondo le migliori pratiche di sicurezza e tutte le comunicazioni con il servizio avvengono tramite HTTPS.\n\n8) Consenso esplicito\nLa registrazione all\u2019app ASConnect richiede il consenso esplicito e informato dell\u2019utente per il trattamento descritto nella sezione 2.\nGli utenti possono revocare il consenso in qualsiasi momento tramite le impostazioni dell\u2019account o contattando contact@fastfrance.org."},
