gqx(){return"Pol\xedtica de privacidade \u2013 app ASConnect\n\n1) Controlador de dados\nOs dados coletados no app ASConnect s\xe3o tratados pela FAST France como controladora de dados.\nSe voc\xea tiver d\xfavidas sobre seus dados ou sobre como exercer seus direitos, entre em contato: contact@fastfrance.org.\n\n2) Finalidades do tratamento\nO tratamento de dados realizado por meio do app serve \xe0s seguintes finalidades:\n\u2022 Criar e gerenciar sua conta de usu\xe1rio para acessar o app ASConnect;\n\u2022 Usar recursos de geolocaliza\xe7\xe3o para exibir:\n  o pontos de interesse relacionados \xe0 s\xedndrome de Angelman,\n  o e/ou perfis de pessoas envolvidas, de acordo com crit\xe9rios diversos (dist\xe2ncia geogr\xe1fica, gen\xf3tipo, faixa et\xe1ria);\n\u2022 Melhorar o servi\xe7o e personalizar a experi\xeancia do usu\xe1rio, incluindo permitir que o usu\xe1rio escolha se deseja exibir uma foto, seu nome ou sobrenome.\n\n3) Categorias de dados coletados\nOs seguintes dados podem ser coletados:\n\u2022 Dados de identifica\xe7\xe3o:\n  o sobrenome, nome, endere\xe7o de e-mail, senha, foto,\n  o pergunta e resposta secretas (em caso de senha esquecida);\n\u2022 Dados sens\xedveis:\n  o gen\xf3tipo, localiza\xe7\xe3o do telefone (geolocaliza\xe7\xe3o).\nA base legal deste tratamento \xe9 o consentimento expl\xedcito e informado do usu\xe1rio.\n\n4) Prazo de reten\xe7\xe3o dos dados\nOs dados s\xe3o mantidos durante o uso da conta e, em seguida, exclu\xeddos no m\xe1ximo em 12 meses ap\xf3s a \xfaltima atividade.\nOs usu\xe1rios podem exercer seu direito ao esquecimento a qualquer momento diretamente no app via:\nPol\xedtica de privacidade \u2192 Direito ao esquecimento.\n\n5) Destinat\xe1rios e hospedagem de dados\nOs dados s\xe3o hospedados com seguran\xe7a nos servidores da PythonAnywhere.\nOs dados s\xe3o armazenados na Uni\xe3o Europeia.\n(Para mais informa\xe7\xf5es sobre a pol\xedtica de privacidade do provedor, consulte https://www.pythonanywhere.com/privacy/.)\n\n6) Direitos dos usu\xe1rios\nDe acordo com o Regulamento (UE) 2016/679 (GDPR), os usu\xe1rios t\xeam os seguintes direitos:\n\u2022 Direito de acesso, retifica\xe7\xe3o e exclus\xe3o (\u201cdireito ao esquecimento\u201d) \u2014 diretamente via perfil ou via Pol\xedtica de privacidade \u2192 Direito ao esquecimento;\n\u2022 Direito de oposi\xe7\xe3o, portabilidade de dados e restri\xe7\xe3o do tratamento;\n\u2022 Direito de retirar o consentimento a qualquer momento.\nPara exercer esses direitos (al\xe9m do direito ao esquecimento no app), envie um e-mail para: contact@fastfrance.org.\n\n7) Seguran\xe7a e confidencialidade\nTodos os dados s\xe3o criptografados durante o armazenamento e a transmiss\xe3o.\nAs senhas s\xe3o protegidas por hash conforme as melhores pr\xe1ticas de seguran\xe7a e toda comunica\xe7\xe3o com o servi\xe7o utiliza HTTPS.\n\n8) Consentimento expl\xedcito\nO registro no app ASConnect exige o consentimento expl\xedcito e informado do usu\xe1rio para o tratamento descrito na se\xe7\xe3o 2.\nOs usu\xe1rios podem retirar o consentimento a qualquer momento nas configura\xe7\xf5es da conta ou entrando em contato com contact@fastfrance.org."},
